OneTwoTrip for Business создан специально для юридических лиц. С нами сотрудники компании могут забронировать авиабилеты, жд билеты и отели для себя и своих коллег в одном месте. 

■ АВИАБИЛЕТЫ
- Приобретайте билеты на самолеты от 800 авиакомпаний в мобильном приложении;
- Находите выгодные предложения благодаря удобным фильтрам и быстрому поиску;
- Оплачивайте корпоративной картой или с расчетного счета компании. Возможна и постоплата. 
А ваша история заказов всегда будет под рукой.

■ ОТЕЛИ (NEW)
Детальный поиск отелей и другие возможности:
- Изучайте детальную информацию об объектах размещения;
- Отбирайте гостиницы по рейтингу, цене, отзывам гостей, количеству звезд.
- Просматривайте бронирование отелей;
- Скачивайте документы, подтверждающие бронь;
У нас вы без труда сможете снять гостиницу без посредников и переплат.

■ Ж/Д БИЛЕТЫ
Заказывайте билеты на поезда РЖД в приложении онлайн. Все для вашего удобства:
- Более 300 направлений по городам России и СНГ;
- Дешевые ЖД билеты на скоростные поезда и поезда дальнего следования: Сапсан, Ласточка, Стриж, Аллегро;
- Выбор наболее удобных места благодаря нашей интерактивной схеме вагонов;
- Удобное расписание поездов;
- История заказов и все документы можно найти в личном кабинете.

■ ЛИЧНЫЙ КАБИНЕТ
Доступ к удобному личному кабинету в приложении. Скачивайте электронные билеты и маршрутные квитанции по командировкам сотрудников. Просматривайте свои авиа, жд и отельные заказы. Обращайтесь в службу поддержки 24/7 прямо из приложения.  

